import React from 'react'

const UserIncome = ({ user }) => {
  var income = user.income
  income = income.substring(1)
  var car =  user.car
  return (
    <div>
      {
        income > 5 && (car === "BMW" || car === "Mercedes-Benz")? 
          <>
            if(car == )
          </> : 
          <>
            <p>False</p>
          </>

      }
    </div>
  )
}

export default UserIncome
